import React from 'react';
import './Style.css'

const TwoLink = [
    {style: {color: 'blue'}, link: '/InternshipReport/Introdu'},
    {style: {color: 'blue'}, link: '/InternshipReport/Développement'},
];

const Développement = () => {
    return (
        <div>
            <h1 className='title'>Développement</h1>
        </div>
    );
};

export default Développement;
